app.post('/sendAll', function(request, res) {
    console.log('start!');
    var totalMail = [];
    request.body.target.forEach(function(item) {
        totalMail = totalMail.concat(mail_data[item]);
    });

    var portion = request.body.sender.length;

    console.log('portion:' + portion);

    var splitMailString = [];

    var counter = 0;
    var tmp = [];

    totalMail.forEach(function(item, index) {
        tmp.push(item);
        counter++;
        if (counter === 500 || index === (totalMail.length - 1)) {
            splitMailString.push(tmp.join(','));
            counter = 0;
            tmp = [];
        }
    });

    var complete = 0;
    var haveHandled = 0;
    for (var i = 0; i < portion; i++) {
        var auth = {
            user: request.body.sender[i].user,
            pass: request.body.sender[i].pass,
        }
        var mail = {
            title: request.body.mail.title,
            content: request.body.mail.content,
            username: request.body.mail.username
        }
        var targetString = splitMailString[i];
        sendMail(auth, mail, targetString, function(error, response) {
            haveHandled++;
            if (response) {
                complete++;
            }
            if (haveHandled == portion) {
                if (complete == haveHandled) {
                    res.send({
                        success: true
                    });
                } else {
                    res.send({
                        success: false,
                        complete: complete
                    })
                }
            }
        });
    }
});


